import React from "react"
import '../App.css';

function SEARCHSTRING() {
  return (
    <div className="search_div">
       <label for="armsearch">поиск</label>
      <input type="text" id="armsearch" placeholder="Введите данные по компании" />

 
    </div>
  )
}

export default SEARCHSTRING;
